import * as React from 'react';
import * as ReactDOM from 'react-dom';
import Router from './app/router'
import './style.scss';
import 'antd/dist/antd.css'
import './assets/fonts/iconfont.scss';
ReactDOM.render(
    <Router/>,
    document.getElementById('root')
);
